sys_script_include.script:
/*** Changes made to this script are not supported by PagerDuty ***/
var FetchRespondersController = x_pd_integration.AjaxHelper.createAjaxController({
  type: 'FetchRespondersController',
  fetchResponders: function fetchResponders(payload) {
    var FetchResponders = new x_pd_integration.FetchResponders();
    var result = FetchResponders.fetchResponders(payload);
    if (result.error) {
      throw new Error(result.error);
    }
    return result;
  }
});
